import React from 'react';

import Header from './Header';
import Footer from './Footer';
import Nota from './Nota';
import notas from '../notas';

function App() {
    return (
        <div>
            <Header />
            {/*Abajo se imprimen multiples componentes Nota.*/}
            {notas.map((nota) => 
                <Nota 
                    key={nota.key}
                    titulo={nota.titulo}
                    contenido = {nota.contenido}
                />            
            )} 
            <Footer />
        </div>
    );
}

export default App;
